/**
 * Sidebar Component
 * -------------------------------------
 * Displays navigation and lists of existing Classes, Relations, and Groups.
 * Contains undo/redo buttons, as well as a reset button for clearing the diagram.
 */

import React from 'react';
import { 
  Box, 
  Typography, 
  List, 
  ListItem, 
  ListItemText, 
  ListItemIcon,
  Divider,
  IconButton,
  Collapse,
} from '@mui/material';
import ClassIcon from '@mui/icons-material/Class';
import LinkIcon from '@mui/icons-material/Link';
import GroupIcon from '@mui/icons-material/Group';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';
import ExpandLess from '@mui/icons-material/ExpandLess';
import ExpandMore from '@mui/icons-material/ExpandMore';

const Sidebar = ({ 
  classes, 
  relations, 
  groups,
  onEditClass,
  onDeleteClass,
  onEditRelation,
  onDeleteRelation,
  onEditGroup,
  onDeleteGroup
}) => {
  const [openSections, setOpenSections] = React.useState({
    classes: true,
    relations: true,
    groups: true
  });

  const toggleSection = (section) => {
    setOpenSections(prev => ({
      ...prev,
      [section]: !prev[section]
    }));
  };

  return (
    <Box sx={{ p: 2, width: '100%' }}>
      {/* Classes Section */}
      <Box sx={{ mb: 2 }}>
        <ListItem 
          button 
          onClick={() => toggleSection('classes')}
          sx={{ bgcolor: 'background.paper', borderRadius: 1 }}
        >
          <ListItemIcon>
            <ClassIcon />
          </ListItemIcon>
          <ListItemText primary="Classes" />
          {openSections.classes ? <ExpandLess /> : <ExpandMore />}
        </ListItem>
        <Collapse in={openSections.classes}>
          <List component="div" disablePadding>
            {classes.map((cls) => (
              <ListItem
                key={cls.id}
                sx={{
                  pl: 4,
                  '&:hover': {
                    bgcolor: 'action.hover',
                  },
                }}
                secondaryAction={
                  <Box>
                    <IconButton 
                      size="small" 
                      onClick={() => onEditClass(cls)}
                    >
                      <EditIcon fontSize="small" />
                    </IconButton>
                    <IconButton 
                      size="small" 
                      onClick={() => onDeleteClass(cls.id)}
                    >
                      <DeleteIcon fontSize="small" />
                    </IconButton>
                  </Box>
                }
              >
                <ListItemText primary={cls.name} />
              </ListItem>
            ))}
          </List>
        </Collapse>
      </Box>

      <Divider sx={{ my: 2 }} />

      {/* Relations Section */}
      <Box sx={{ mb: 2 }}>
        <ListItem 
          button 
          onClick={() => toggleSection('relations')}
          sx={{ bgcolor: 'background.paper', borderRadius: 1 }}
        >
          <ListItemIcon>
            <LinkIcon />
          </ListItemIcon>
          <ListItemText primary="Relations" />
          {openSections.relations ? <ExpandLess /> : <ExpandMore />}
        </ListItem>
        <Collapse in={openSections.relations}>
          <List component="div" disablePadding>
            {relations.map((rel) => {
              const sourceClass = classes.find(c => c.id === rel.source);
              const targetClass = classes.find(c => c.id === rel.target);
              return (
                <ListItem
                  key={rel.id}
                  sx={{
                    pl: 4,
                    '&:hover': {
                      bgcolor: 'action.hover',
                    },
                  }}
                  secondaryAction={
                    <Box>
                      <IconButton 
                        size="small" 
                        onClick={() => onEditRelation(rel)}
                      >
                        <EditIcon fontSize="small" />
                      </IconButton>
                      <IconButton 
                        size="small" 
                        onClick={() => onDeleteRelation(rel.id)}
                      >
                        <DeleteIcon fontSize="small" />
                      </IconButton>
                    </Box>
                  }
                >
                  <ListItemText 
                    primary={`${sourceClass?.name} â†’ ${targetClass?.name}`}
                    secondary={rel.type}
                  />
                </ListItem>
              );
            })}
          </List>
        </Collapse>
      </Box>

      <Divider sx={{ my: 2 }} />

      {/* Groups Section */}
      <Box sx={{ mb: 2 }}>
        <ListItem 
          button 
          onClick={() => toggleSection('groups')}
          sx={{ bgcolor: 'background.paper', borderRadius: 1 }}
        >
          <ListItemIcon>
            <GroupIcon />
          </ListItemIcon>
          <ListItemText primary="Groups" />
          {openSections.groups ? <ExpandLess /> : <ExpandMore />}
        </ListItem>
        <Collapse in={openSections.groups}>
          <List component="div" disablePadding>
            {groups.map((group) => (
              <ListItem
                key={group.id}
                sx={{
                  pl: 4,
                  '&:hover': {
                    bgcolor: 'action.hover',
                  },
                }}
                secondaryAction={
                  <Box>
                    <IconButton 
                      size="small" 
                      onClick={() => onEditGroup(group)}
                    >
                      <EditIcon fontSize="small" />
                    </IconButton>
                    <IconButton 
                      size="small" 
                      onClick={() => onDeleteGroup(group.id)}
                    >
                      <DeleteIcon fontSize="small" />
                    </IconButton>
                  </Box>
                }
              >
                <ListItemText 
                  primary={group.name}
                  secondary={`${group.members?.length || 0} members`}
                />
              </ListItem>
            ))}
          </List>
        </Collapse>
      </Box>
    </Box>
  );
};

export default Sidebar;
